{
    ["MOD_FILENAME"] 	    = "FF_"..METADATA_MOD_NAME.."_"..METADATA_MOD_MODULE.."_"..METADATA_NMS_VERSION..".pak",
    ["MOD_AUTHOR"]		    = METADATA_MOD_AUTHOR,
    ["LUA_AUTHOR"]		    = METADATA_LUA_AUTHOR,
    ["NMS_VERSION"]		    = METADATA_NMS_VERSION,
    ["MOD_DESCRIPTION"]     = METADATA_MOD_DESC,
    ["ADD_FILES"]           = {},
}

function BuildSection (_list,_section)
    for path,data in next,_list do
        local newfile =
        {
            ["FILE_DESTINATION"] = path,
            ["FILE_CONTENT"] = data,
        }
        _section[#_section+1] = newfile
    end
end

BuildSection(LIST_FILES,NMS_MOD_DEFINITION_CONTAINER["ADD_FILES"])

